<title>Bookmarklets<title>
<link rel="icon" type="image/x-icon" href="favicon.png">
<p style="font-family: Arial">
<h1 id="how-to-install-a-bookmarklet-">How to install a bookmarklet?</h1>
<ol>
<li>Create a bookmark (the star on the right side of the url bar if you are using chrome)</li>
<li>Click on more at the bottom left corner</li>
<li>Delete everything in the url box</li>
<li>Paste in the code.</li>
</ol>
<h1 id="-useful-bookmarklets-">--Useful Bookmarklets--</h1>
<ul>
<li><h2 id="autoclicker-click-where-you-want-and-it-will-click-automaticly-it-clicks-100-times-every-second-100cps-works-on-some-website-">AutoClicker - Click where you want, and it will click automaticly. it clicks 100 times every second (100cps). (Works on some website)</h2>

</code></pre>

</li>
<li><h2 id="findinarchive-org-search-for-the-website-you-re-on-on-web-archive-wayback-machine-">FindInArchive.org - Search for the website you&#39;re on on Web Archive (Wayback Machine)</h2>

</li>
</ul>
